import React from "react";

const Datafilter = ({data}) => {
	const filteredData = data.filter((datas) => {
	return datas.population != null;
		});
	function split(arr){
		const sorter = [];
		for(var i = 0; i < arr.length-1; i++){
			sorter.push(arr[i]);
		}
		console.log(sorter);
	};
	function sort(array, prop) {
    	return array.sort(function (a, b) {
      		return a[prop].total > b[prop].total
		        ? -1
		        : b[prop].total > a[prop].total
		        ? 1
		        : 0;
		    });
  }
	const splittedData = split(filteredData);
	//console.log(filteredData[0].tests);
	return(
		<div>{"Helloo"}</div>
		)
}

export default Datafilter;
